import React from 'react'
import '../style/Browsing.css'

export default class BrowsingNav extends React.Component{

  constructor(props){
    super(props);
    this.state = {
      navItems: props.navItems,
      handleClick: props.handleClick
    }
  }

  render() {
    return(
      <nav>
        <ul className='nav-menu'>
          {this.state.navItems && this.state.navItems.map((item, index) => {
            return(
              <li onClick={() => this.state.handleClick(item)} key={index}>
                  {item.title}
              </li>
            )
          })}
        </ul>
      </nav>
    );
  }

}
